import React from 'react';


function ChoiceMenu(props) {
  return(
    <div>

      <p className="title">Welcome to my-solid-blog</p>
        <p>You can use this application by Logging in with you Solid Identity Provider or entering a valid webId of a user (without any login process)</p>
      <div className="columns">
        <div className="column is-one-quarter">
          <button className="button is-warning is-large is-fullwidth">
            Log&nbsp;in
          </button>
        </div>
        <div className="column is-one-quarter">
        <button className="button is-danger is-large is-fullwidth">
            Enter WebId
          </button>
        </div>
      </div>
    </div>
  );
}

export default ChoiceMenu;
